import PropTypes from "prop-types";

const GroupComponent = ({ className = "" }) => {
  return (
    <div
      className={`bg-[#f7cc5f] flex flex-col items-center p-6 gap-6 text-center text-[#000] font-[Inter] ${className}`}
    >
      <div className="flex items-center justify-center">
        <div className="bg-[#ff6262] rounded-full p-2 relative">
          <img
            className="w-6 h-6"
            loading="lazy"
            alt="Notification"
            src="/vuesaxlinearnotification.svg"
          />
          <span className="absolute top-0 left-0 text-white text-xs flex items-center justify-center w-full h-full">1</span>
        </div>
      </div>
      <div className="flex flex-col items-center text-center">
        <h3 className="text-2xl font-bold">
          Vince Albert Juson
        </h3>
        <p className="text-lg text-[#787486]">Student</p>
      </div>
    </div>
  );
};

GroupComponent.propTypes = {
  className: PropTypes.string,
};

export default GroupComponent;
